import React, { useState } from 'react';
import PhotoList from './PhotoList';
import './Photo.css';

const STATUS = {
	HOVERED: 'hovered',
	NORMAL: 'normal',
};

const Photo = ({ images }) => {
	const [color, setColor] = useState(STATUS.NORMAL);

	function _onMouseEnter() {
		setColor(STATUS.HOVERED);
	}

	function _onMouseLeave() {
		setColor(STATUS.NORMAL);
	}

	return (
		<div>
			<h2 className={color} onMouseEnter={_onMouseEnter} onMouseLeave={_onMouseLeave}>
				TEST
			</h2>
			<PhotoList images={images} />
		</div>
	);
};

export default Photo;
